module.exports={title:"Portal Único de Acesso ao Ensino Superior",welcomeText:"<p>Agora o <strong>Sisu, Prouni e Fies estão disponíveis num único lugar.</strong> Aqui você pode explorar todas as suas possibilidades de ingressar em um curso superior para realizar o seu sonho!</p",balloonTop:{text:"<p>O <strong>Acesso Único</strong> é desenvolvido a partir de experiências de estudantes que se inscreveram em edições anteriores do <strong>Sisu, Prouni e Fies. Vem com o MEC!</strong></p>"},balloonRight:{text:"<p>Venha entender o passo a passo para aproveitar as oportunidades ofertadas pelo MEC para entrar na universidade. Veja nossas dicas!</p>",action:{title:"Clique aqui",uri:"/formas-de-acesso"}},balloonRightBottom:{text:"<p>Já sabe o que fazer para se inscrever e quer ir direto ao que te interessa? Acesse logo os sistemas de inscrição dos programas de acesso ao ensino superior do MEC. Boa sorte, bons estudos!</p>",action:{title:"Clique aqui",uri:"/programas"}},programs:[{title:"SISU - logo",asset:"../../assets/img/logo_sisu.png",action:{title:"Clique aqui",uri:"/programas"}},{title:"PROUNI - logo",asset:"../../assets/img/logo_prouni.png",action:{title:"Clique aqui",uri:"/prouni"}},{title:"FIES - logo",asset:"../../assets/img/logo_fies.png",action:{title:"Clique aqui",uri:"/fies"}}],cards:[{icon:"../../assets/img/home_busca.png",title:"Busca Avançada",text:"Agora você mesmo, estudante, pode pesquisar facilmente os dados de edições anteriores <strong>do Sisu, Prouni e Fies.</strong>",action:{title:"Realizar Busca",uri:"/busca"}},{icon:"../../assets/img/home_acesso_4.png",title:"Acesso Único",text:"Informe-se sobre o <strong>Projeto Acesso Único</strong>, que reúne os programas do SISU, PROUNI e FIES no mesmo lugar.",action:{title:"Saber mais",uri:"/acesso-unico"}}],carrossel:[{text:"Sisu | Prouni | Fies | Inscrições (1º Semestre de 2023)",uri:"https://www.youtube.com/embed/W9QbqzSYn90"}]};
