module.exports={title:"FIES",alias:"fies",calendar:[{text:"Complementação da inscrição postergada",textDate:"07 a 09 de Fev",startDate:"2023-02-07T00:00:00",endDate:"2023-02-09T23:59:59",uri:"https://fiesselecaoaluno.mec.gov.br"},{text:"Período de inscrições",textDate:"07 a 10 de Mar",startDate:"2023-03-07T00:00:00",endDate:"2023-03-10T23:59:59",uri:"https://fiesselecaoaluno.mec.gov.br",buttonText:"Inscreva-se"},{text:"Resultado",textDate:"14 de Mar",startDate:"2023-03-14T00:00:00",endDate:"2023-03-14T23:59:59",uri:"https://fiesselecaoaluno.mec.gov.br",buttonText:"Consultar"},{text:"Complementação das informações da inscrição",textDate:"15 a 17 de Mar",startDate:"2023-03-15T00:00:00",endDate:"2023-03-17T23:59:59",uri:"https://fiesselecaoaluno.mec.gov.br",buttonText:"Complementar"},{text:"Convocação da lista de espera",textDate:"21 de Mar a 18 de Mai",startDate:"2023-03-21T00:00:00",endDate:"2023-05-18T23:59:59",uri:"https://fiesselecaoaluno.mec.gov.br",buttonText:"Consultar"}],avatar:{uri:"",text:"Inscreva-se no <strong>FIES</strong> e conquiste a vaga dos seus sonhos por meio do financiamento estudantil."},videos:[],download:{text:"Ver e baixar documentações",uri:""},content:[{title:"O QUE É?",text:"O Fundo de Financiamento Estudantil (FIES) é um programa do Ministério da Educação (MEC), instituído pela Lei nº 10.260, de 12 de julho de 2001, que tem como objetivo conceder financiamento a estudantes em cursos superiores não gratuitos, com avaliação positiva Sistema Nacional de Avaliação da Educação Superior (Sinaes) e ofertados por instituições de educação superior não gratuitas aderentes ao programa. A partir de 2018, o FIES possibilita juros zero a quem mais precisa e uma escala de financiamento que varia conforme a renda familiar do candidato. O financiado começará a pagar as prestações respeitando o seu limite de renda, fazendo com que os encargos a serem pagos diminuam consideravelmente."}],topics:[{title:"Como participar?",text:"<p>Se inscrevendo nos processos seletivos, em datas definidas nos editais da Secretaria de Educação Superior (SESu).</p><p>Poderá se inscrever no FIES, o candidato que tenha participado do ENEM, a partir da edição de 2010 e tenha obtido média aritmética das notas nas provas igual ou superior a 450 (quatrocentos e cinquenta) pontos e nota superior a 0 (zero) na redação. Também é necessário possuir renda familiar mensal bruta, por pessoa, de até 3 (três) salários mínimos.</p><p>Competindo, exclusivamente, ao candidato certificar–se de que cumpre aos requisitos estabelecidos para concorrer ao referido processo seletivo, observadas as vedações previstas no edital do processo seletivo vigente.</p>"},{title:"Como se inscrever no Fies",text:"<p>Acessando o sistema de inscrição do FIES, em período determinado em edital e possuir cadastro no \"Login Único\" do governo federal, conta <a href='https://sso.acesso.gov.br/login?client_id=contas.acesso.gov.br&authorization_id=17e59336eff'>gov.br</a>.</p><p>Caso não possua uma conta gov.br, será direcionado para a página do <a href='https://sso.acesso.gov.br/login?client_id=contas.acesso.gov.br&authorization_id=17e59336eff'>gov.br</a>, onde deverá efetuar seu cadastro preenchendo todas as informações solicitadas.</p><p>Após concluído o cadastro, você será direcionado automaticamente para o sistema de inscrição do FIES, é só preencher as informações solicitadas pelo sistema.</p>"},{title:"Como recuperar sua senha da conta gov.br",text:"Acesse <a href='https://acesso.gov.br/?_ga=2.227069012.81628025.1642173963-2008478269.1642173963'>https://acesso.gov.br</a> digite o número CPF no campo indicado da tela inicial e clique no botão <strong>Avançar</strong>, seguindo os procedimentos solicitados."},{title:"Tire suas dúvidas sobre a renda familiar mensal bruta per capita",text:"O cálculo da renda familiar mensal bruta per capita, é feita com base na soma da renda bruta de todos os membros do grupo familiar, dividida pelo número total de pessoas pertencentes ao referido grupo familiar."}],buttons:[{text:"Ver legislação do programa",uri:"http://portalfies.mec.gov.br/?pagina=legislacao",isForever:!0},{text:"Complementação da inscrição postergada",uri:"https://fiesselecaoaluno.mec.gov.br",startDate:"2023-02-07T00:00:01",endDate:"2023-02-09T23:59:59"},{text:"Consultar ofertas de vagas",uri:"https://fiesselecaoaluno.mec.gov.br/consulta",startDate:"2023-03-01T00:00:01",endDate:"2023-05-18T23:59:59"},{text:"Ver inscrição",uri:"https://fiesselecaoaluno.mec.gov.br",startDate:"2023-03-07T00:00:01",endDate:"2023-03-10T23:59:59"}]};
