module.exports={title:"Formas de Acesso ao Ensino Superior",subTitle:"Como ingressar no ensino superior",action:{title:"Acessar página de inscrições dos programas",titleShort:"Inscrições dos programas",uri:"/programas"},balloon:{text:"Estudante, venha explorar todas as oportunidades que o MEC oferece para você entrar em um curso superior e se graduar.",textShort:"Estudante, venha explorar todas as oportunidades que o MEC oferece para você entrar em um curso superior e se graduar."},steps:[{id:"Q1",icon:"../../assets/img/journey_01_notebooks.png",text:"Só com o ensino médio completo você pode ingressar numa instituição de ensino superior, no Brasil. Então, o primeiro passo é se certificar se você atende ou atenderá a esse critério até o prazo da matrícula na universidade. Não perca tempo!"},{id:"Q2",icon:"../../assets/img/journey_02_enem.png",text:"Outro critério é ter feito o Exame Nacional do Ensino Médio (ENEM). Para quem tem nota do Enem mais recente há mais oportunidades porque poderá disputar vagas do <strong>Sisu, Prouni e Fies.</strong>"},{id:"Q3",icon:"../../assets/img/journey_03_sisu.png",text:"Seu objetivo é ingressar em uma instituição pública? O Sistema de Seleção Unificada (Sisu) oferta vagas em instituições federais (universidades e institutos) e demais públicas, que podem ser estaduais ou municipais. Veja como é fácil participar do Sisu!",action:{title:"Conheça o SISU",uri:"/sisu"}},{id:"Q4",icon:"../../assets/img/journey_04_prouni.png",text:"Para ingressar em instituições privadas de ensino superior, o MEC oferta bolsas de estudo, por meio do Programa Universidade Para Todos (Prouni), e vagas para financiamento pelo Fundo de Financiamento Estudantil (Fies).",action:{title:"Conheça o PROUNI",uri:"/prouni"}},{id:"Q5",icon:"../../assets/img/journey_05_light.png",text:"Você sabia que quem tem bolsa parcial do Prouni pode financiar os outros 50% do valor do curso por meio do Fies? Pois é, saiba mais aqui sobre essa dupla chance de estudar que o MEC oferece para você!"},{id:"Q6",icon:"../../assets/img/journey_06_fies.png",text:"Se você está de olho mesmo é nas vagas para financiar o seu curso superior, a sua melhor oportunidade é o Fies. Quem fez edições passadas do Enem, a partir do Enem de 2010, têm chances também. Veja como e garanta a sua chance!",action:{title:"Conheça o FIES",uri:"/fies"}},{id:"Q7",icon:"../../assets/img/journey_07_docs.png",text:"Chegou a hora do passo mais importante. Garantir a sua oportunidade, seja no Sisu, no Prouni ou Fies, sem perder os prazos para a entrega da documentação exigida para cada situação específica de ingresso. Para te ajudar a se organizar direitinho, apresentamos esse box só sobre documentação exigida.",action:{title:"Documentação",uri:"/documentacao"}},{id:"Q8",icon:"../../assets/img/journey_08_backpack.png",text:"<p>Atenção com os prazos para entrega dos documentos! Acompanhe sempre o cronograma e a página da instituição para a qual você foi selecionado.</p><p>Parabéns, você conseguiu! Seu sonho virou realidade, calouro!</p>"}],balloon2:{text:"Agora que você está a um passo para ser mais um participante dos processos seletivos do Sisu, Prouni e Fies, veja mais do nosso conteúdo. Aqui do lado tem mais dicas para você.",textShort:"Agora que você está a um passo para ser mais um participante dos processos seletivos do Sisu, Prouni e Fies, veja mais do nosso conteúdo. Aqui do lado tem mais dicas para você."},videos:[]};
