module.exports={title:"Entenda o que é o Projeto Acesso Único",subtitle:"Projeto Portal Único de Acesso ao Ensino Superior",text:"<p>O MEC está redesenhando soluções de tecnologia para os seus sistemas eletrônicos, por meio dos quais são ofertadas oportunidades de acesso ao ensino superior, como o Sistema de Seleção Unificada (<a href='/sisu'>Sisu</a>), Programa Universidade para Todos (<a href='/prouni'>Prouni</a>) e Fundo de Financiamento Estudantil (<a href='/fies'>Fies</a>). Trata-se do Projeto Acesso Único, iniciado com o desenvolvimento do Portal Único de Acesso ao Ensino Superior (Acesso Único), que tem a mesma marca do projeto, sendo uma parte relevante dele, mas não o todo. Ambos, projeto e novo portal, continuarão em desenvolvimento, ganhando ampliações e aprimoramentos, até o final do ano.</p><p>O Projeto Acesso Único está alicerçado em princípios como: segurança digital, modernidade, transparência, participação do usuário, integração, inteligência, monitoramento e economicidade.</p><p>Para quem vai participar de mais de um processo seletivo só precisará inserir as informações cadastrais para inscrição uma única vez. A partir do primeiro registro de dados gerais de cadastro, o sistema do Acesso Único armazenará esses dados para que o candidato não precise repeti-los caso tente se inscrever nos demais processos seletivos vigentes. Precisará apenas complementar as informações que forem específicas de cada seleção, observar se atende aos critérios para a participação e confirmar a sua inscrição, quando for o caso. Ou seja, o estudante não mais perderá tempo com repetições de digitação de dados inseridos antes, em algum dos três sistemas de inscrição.</p>",video:{},steps:[{icon:"fas fa-home",text:"Portal sobre os Programas de Acesso ao Ensino Superior",startDate:"",endDate:"",status:"active"},{icon:"fas fa-home",text:"Inscrição <br /> Unificada",startDate:"",endDate:"",status:"waiting"},{icon:"fas fa-home",text:"Integração dos Processos Seletivos",startDate:"",endDate:"",status:"waiting"},{icon:"fas fa-home",text:"Chatbot e outros suportes",startDate:"",endDate:"",status:"waiting"},{icon:"fas fa-home",text:"Otimização dos processos",startDate:"",endDate:"",status:"waiting"},{icon:"fas fa-home",text:"Conclusão <br /> do Acesso Único",startDate:"",endDate:"",status:"waiting"}]};
